  "description": "Sven Magnus Eldh was a district physician in the city of Gothenburg. He completed his high school studies in Gothenburg in 1918, received his Bachelor of Medicine degree in Stockholm in 1923, and his medical license there in 1927. He did study trips to Germany, England and France in 1927, 1932, 1933 and 1937. He worked as an intern and assistant at the pathology institute in Stockholm in 1925 and as an assisting physician at Asö hospital in 1926. He became a resident physician, acting intern, acting medical officer at the Serafimer Hospital medical clinic from 1926 to 1928, an assisting physician at the Sahlgrenska hospital's medical department in 1928, Under Physician at Ulricehamns sanatorium from 1928 to 1929, acting intern and under physician at the Sahlgrenska Hospital's medical department from 1929 to 1935, temporary under physician at Lillhagen's hospital in 1935, an intern at Lund's psychiatric clinic in 1936, and a practicing physician in Gothenburg since 1937, serving as a district physician there since 1938. He has written papers on internal medicine and neurology."
